   element!.style.fontSize = this.fontSize + "px";
  }
  private changeIconsize():void {
   const element: HTMLElement = (document.querySelector(".p-button-icon")) as HTMLElement;
   element!.style.fontSize = this.iconSize + "px";
  }
}

