  grid-template-rows: 1fr 1fr 1fr;
  gap: 20px 20px;
  grid-template-areas:
    "slajdy panel__login-register panel__login-register"
    "slajdy panel__login-register panel__login-register"
    "slajdy signUs other";
  margin: auto;
  max-width: 1600px;
}

.slajdy {
  grid-area: slajdy;

  &__content {
  padding: 200px 100px;
  }
}

.panel {
  &__login-register {
    grid-area: panel__login-register;
  }

  &__logo {
    display: flex;
    justify-content: center;
    padding: 30px 0 40px 0;

    img {
      max-height: 50px;
    }
  }

  &__center {
    display: flex;
    justify-content: center;
    padding-bottom: 40px;
  }
}

.signUs {
  grid-area: signUs;

  &__content {
    display: flex;
    justify-content: center;
    padding: 40px 0;
  }
}

.other {
  grid-area: other;

  &__content {
    display: flex;
    justify-content: center;
    padding: 40px 0;
  }
}

